import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import AppLayout from './layouts/admin/AppLayout';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/admin" name="Admin" render={(props) => <AppLayout {...props} />}  />      
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
